import React, { useState } from "react";
import "./css/App.css";
import namesData from "./data/namesData.json";

function App() {
  const [searchTerm, setSearchTearm] = useState("");
  return (
    <div className="App">
      <header className="App-header">
        <input 
        type="text" 
        value={searchTerm} onChange={(event => setSearchTearm)}/>
        <div>
          {namesData
            .sort((a, z) => a.name.localeCompare(z.name))
            .map((nameObject) => {
              const { id, name, sex } = nameObject;
              const isBoy = sex === "m";
              return (
                <div style={{ color: isBoy ? "royalblue" : "pink" }}>
                  {name}
                </div>
              );
            })}
        </div>
      </header>
    </div>
  );
}

export default App;
